import React, { Component } from 'react';

class Email extends Component {

    render() {
        return (
            <div className="Email">
                Email:
                <input
                    type="text"
                    name="Email"
                    onChange={this.props.handleInput}/>
                <label>{this.props.error}</label>
            </div>
        );
    }
}

export default Email;
